import React from 'react';

const statusOptions = ['incomplete', 'in progress', 'complete'];

function TaskList({ tasks, updateTask, deleteTask, currentUser, setEditingTask }) {
  const handleStatusChange = (task, e) => {
    updateTask({ ...task, status: e.target.value });
  };

  const isOverdue = (dueDate) => {
    const today = new Date();
    const due = new Date(dueDate);
    return due < today && dueDate !== '';
  };

  return (
    <div style={{ backgroundColor: '#fff', padding: '15px', borderRadius: '12px', boxShadow: '0 0 10px rgba(0,0,0,0.1)' }}>
      <h2>Tasks</h2>
      {tasks.length === 0 ? (
        <p>No tasks to display.</p>
      ) : (
        <table style={{ width: '100%', borderCollapse: 'collapse', fontSize: '0.95rem' }}>
          <thead>
            <tr>
              <th style={{ borderBottom: '2px solid #764ba2', padding: '12px 15px' }}>Title</th>
              <th style={{ borderBottom: '2px solid #764ba2', padding: '12px 15px' }}>Description</th>
              <th style={{ borderBottom: '2px solid #764ba2', padding: '12px 15px' }}>Status</th>
              <th style={{ borderBottom: '2px solid #764ba2', padding: '12px 15px' }}>Urgency</th>
              <th style={{ borderBottom: '2px solid #764ba2', padding: '12px 15px' }}>Assigned To</th>
              <th style={{ borderBottom: '2px solid #764ba2', padding: '12px 15px' }}>Due Date</th>
              <th style={{ borderBottom: '2px solid #764ba2', padding: '12px 15px' }}>Actions</th>
            </tr>
          </thead>
          <tbody>
            {tasks.map((task) => (
              <tr key={task.id} className={isOverdue(task.dueDate) ? 'overdue' : ''} style={{ transition: 'background-color 0.3s ease' }}>
                <td style={{ borderBottom: '1px solid #eee', padding: '12px 15px' }}>{task.title}</td>
                <td style={{ borderBottom: '1px solid #eee', padding: '12px 15px' }}>{task.description}</td>
                <td style={{ borderBottom: '1px solid #eee', padding: '12px 15px' }}>
                  <select value={task.status} onChange={(e) => handleStatusChange(task, e)} style={{ padding: '6px 10px', borderRadius: '6px', border: '1px solid #ccc' }}>
                    {statusOptions.map((status) => (
                      <option key={status} value={status}>
                        {status.charAt(0).toUpperCase() + status.slice(1)}
                      </option>
                    ))}
                  </select>
                </td>
                <td style={{ borderBottom: '1px solid #eee', padding: '12px 15px', color: task.urgency === 'high' ? '#d9534f' : task.urgency === 'medium' ? '#f0ad4e' : '#5cb85c', fontWeight: '600' }}>
                  {task.urgency.charAt(0).toUpperCase() + task.urgency.slice(1)}
                </td>
                <td style={{ borderBottom: '1px solid #eee', padding: '12px 15px' }}>{task.assignedTo}</td>
                <td style={{ borderBottom: '1px solid #eee', padding: '12px 15px' }}>{task.dueDate}</td>
                <td style={{ borderBottom: '1px solid #eee', padding: '12px 15px', display: 'flex', gap: '8px' }}>
                  <button onClick={() => setEditingTask(task)} style={{ backgroundColor: '#5bc0de', padding: '6px 12px', borderRadius: '6px', color: '#fff', border: 'none', cursor: 'pointer' }}>
                    Edit
                  </button>
                  <button onClick={() => deleteTask(task.id)} style={{ backgroundColor: '#d9534f', padding: '6px 12px', borderRadius: '6px', color: '#fff', border: 'none', cursor: 'pointer' }}>
                    Delete
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default TaskList;
